import React, { useState, useEffect } from 'react';
import { transactionsApi } from '../supabase';

interface Transaction {
  id: number;
  type: 'income' | 'expense';
  amount: number;
  category: string;
  description: string;
  date: string;
  created_at: string;
}

const TransactionViewer: React.FC = () => {
  const [transactions, setTransactions] = useState<Transaction[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const loadTransactions = async () => {
    setLoading(true);
    setError(null);
    
    try {
      const { data, error } = await transactionsApi.fetchTransactions();
      
      if (error) {
        setError(`Error: ${JSON.stringify(error)}`);
        console.error('Error fetching transactions:', error);
      } else {
        setTransactions(data || []);
        console.log('Loaded transactions:', data);
      }
    } catch (err) {
      setError(`Connection error: ${err}`);
      console.error('Connection error:', err);
    }
    
    setLoading(false);
  };

  useEffect(() => {
    loadTransactions();
    
    // Refresh every 5 seconds to show real-time updates
    const interval = setInterval(loadTransactions, 5000);
    
    return () => clearInterval(interval);
  }, []);

  const formatDate = (dateString: string) => {
    return new Date(dateString).toLocaleString();
  };

  return (
    <div style={{ 
      padding: '20px', 
      margin: '20px', 
      borderRadius: '12px',
      background: 'linear-gradient(135deg, #4facfe 0%, #00f2fe 100%)',
      color: 'white',
      boxShadow: '0 8px 32px rgba(0,0,0,0.2)',
      border: '2px solid #fff',
      position: 'relative',
      overflow: 'hidden'
    }}>
      {/* Decorative elements */}
      <div style={{
        position: 'absolute',
        top: '-40px',
        left: '-40px',
        width: '80px',
        height: '80px',
        background: 'rgba(255,255,255,0.1)',
        borderRadius: '50%'
      }}></div>
      <div style={{
        position: 'absolute',
        bottom: '-20px',
        right: '-20px',
        width: '40px',
        height: '40px',
        background: 'rgba(255,255,255,0.1)',
        borderRadius: '50%'
      }}></div>
      
      <div style={{ position: 'relative', zIndex: 1 }}>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '15px' }}>
          <h3 style={{ 
            margin: 0, 
            fontSize: '20px',
            fontWeight: 'bold',
            textShadow: '2px 2px 4px rgba(0,0,0,0.3)'
          }}>
            ðŸ“Š Real-time Transactions from Supabase
          </h3>
          <button 
            onClick={loadTransactions} 
            disabled={loading}
            style={{ 
              padding: '10px 20px', 
              backgroundColor: loading ? '#ccc' : '#ff6b6b', 
              color: 'white', 
              border: 'none', 
              borderRadius: '6px',
              fontWeight: 'bold',
              cursor: loading ? 'not-allowed' : 'pointer',
              boxShadow: '0 4px 15px rgba(0,0,0,0.2)',
              transition: 'all 0.3s ease'
            }}
          >
            {loading ? 'ðŸ”„ Loading...' : 'ðŸ”„ Refresh'}
          </button>
        </div>
      
      {error && (
        <div style={{ color: 'red', marginBottom: '10px' }}>
          {error}
        </div>
      )}
      
        <div style={{ fontSize: '16px', marginBottom: '15px', fontWeight: 'bold' }}>
          ðŸ“ˆ Total transactions: {transactions.length}
        </div>
        
        <div style={{ maxHeight: '300px', overflowY: 'auto' }}>
          {transactions.length === 0 ? (
            <div style={{ 
              textAlign: 'center', 
              color: 'rgba(255,255,255,0.8)', 
              padding: '30px',
              fontSize: '16px',
              fontStyle: 'italic'
            }}>
              {loading ? 'ðŸ”„ Loading transactions...' : 'ðŸ“­ No transactions found'}
            </div>
          ) : (
            transactions.map((transaction) => (
              <div 
                key={transaction.id} 
                style={{ 
                  padding: '15px', 
                  margin: '8px 0', 
                  backgroundColor: 'rgba(255,255,255,0.9)', 
                  borderRadius: '8px',
                  border: '1px solid rgba(255,255,255,0.3)',
                  boxShadow: '0 4px 15px rgba(0,0,0,0.1)',
                  color: '#333'
                }}
              >
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                  <div>
                    <strong style={{ 
                      color: transaction.type === 'income' ? '#28a745' : '#dc3545',
                      fontSize: '16px'
                    }}>
                      {transaction.type === 'income' ? '+' : '-'}${transaction.amount}
                    </strong>
                    <span style={{ marginLeft: '15px', fontSize: '14px' }}>{transaction.description}</span>
                  </div>
                  <div style={{ 
                    fontSize: '12px', 
                    color: '#666',
                    backgroundColor: 'rgba(0,0,0,0.1)',
                    padding: '4px 8px',
                    borderRadius: '4px'
                  }}>
                    {transaction.category}
                  </div>
                </div>
                <div style={{ fontSize: '12px', color: '#666', marginTop: '8px' }}>
                  ðŸ•’ {formatDate(transaction.created_at)}
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </div>
  );
};

export default TransactionViewer;
